import React,{useEffect} from 'react';
import UsersList from '../components/UsersList'
const Users = () => {
  useEffect(()=>{
    const sendRequest = () => {}
    fetch('http://localhost:5000/api/users');
  },[]);


  return <UsersList items={USERS}/>
};

export default Users;
